        filmes: [],
    }

    async componentDiMount(){
        const response = await api.get('')
        console.log(response.data);

        this.setState({ filmes: response.data})
    }

    render() {

        const { filmes } = this.state;
        return (
            <>

            console.log(filmes)

            <S.Container>
            <h1> Lista Filmes </h1>
                <Header></Header>
            </S.Container>
            </>
        )
    }
}
